import React from 'react'
import '../css/styles.css'
import Header from '../Header'
import Footer from '../Footer'

const Layout = ({ children }) =>{
    return(
        <div>
            <Header/>
            <div className= 'container mx-auto'>
              { children }
            </div>
            <Footer/>
        </div>
    )
}

export default Layout
